import sys
from collections import deque

def solve(s):
    n = len(s)
    dp = deque([0] * (n + 1))

    for i in range(len(s)):
        if s[i] == '0':
            dp.appendleft(-1)
        else:
            dp.appendright(1)

    return sum(dp)

