import sys
from typing import List

class Solution(object):
    def findKthLargest(self, nums: List[int], k: int) -> int:
        if len(nums) < k+1 or not isinstance(k, int):
            return -1

        # sort by ascending order
        nums = sorted(nums)
        i = j = 0
        while i <= j:
            if i >= j:
                break

            if nums[i] > nums[j]:
                i += 1
            else:
                j -= 1

        return (len(nums)-k)+i
